import './style.css';
import arrowLeft from './resources/arrow-left-circle.svg';
import arrowRight from './resources/arrow-right-circle.svg';
import logo from './logo.svg';
import iphone from './resources/iphonex.png';
import nature from './resources/nature.jpg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';


function Product(){
    return(
        <div class="card h-100">

            <img src={iphone} class="card-img-top" alt="alt-image-cap" id="product-photo"/>

            <div class="card-body d-flex flex-column">
                <h5 class="card-title">6000 kr</h5>
                <p class="card-text"><small class="text-muted">Bergen</small></p>
                <i class="fas fa-heart"></i>
                <p class="card-text">Pent brukt Iphone X. Kjopt in 2019. Ny pris: 2345 kr. Ma hentes.</p>
                <div class="text-center mt-auto">
                    <button class="btn btn-primary w-40 me-3">Send Message</button>
                    <button type="button" class="btn btn-outline-danger w-40">Add to Favorites<svg xmlns="http://www.w3.org/2000/svg" x="0px" y="0px"
width="32" height="32"
viewBox="0 0 48 48"
style=" fill:#000000;"><linearGradient id="4LyKu8AtUK4gmSHjQsrKja_DFU1kReSUccu_gr1" x1="15.941" x2="35.261" y1="-158.617" y2="-188.37" gradientTransform="matrix(1 0 0 -1 0 -154)" gradientUnits="userSpaceOnUse"><stop offset=".002" stop-color="#f44f78"></stop><stop offset=".397" stop-color="#e4305d"></stop><stop offset=".763" stop-color="#d81b4a"></stop><stop offset="1" stop-color="#d41343"></stop></linearGradient><path fill="url(#4LyKu8AtUK4gmSHjQsrKja_DFU1kReSUccu_gr1)" d="M24,12.25c0,0,4.701-5.25,10.5-5.25S45,11.765,45,17.5c0,3.555-3.501,6.999-3.501,6.999	l-15.728,15.73c-0.978,0.978-2.565,0.978-3.543,0L6.501,24.499c0,0-3.501-3.446-3.501-6.999C3,11.765,7.701,7,13.5,7	S24,12.25,24,12.25z"></path></svg></button>
                </div>
            </div>
        </div>   
    );
}

export default Product;
